Type of the task used during behavioural trials: 
active choice = go/go tasks in which an animal is required to make an active response to cues perceived as positive and to cues perceived as negative;
go/no-go = tasks in which an animal is required to suppress a response to cues perceived as negative and actively respond only to cues perceived as positive

